import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PaymentForm from './components/home/PaymentForm';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path='/payment-form' Component={ PaymentForm }/>
        </Routes>
      </div>
    </Router>

  );
}

export default App;
